import React from 'react'
import './item.css'
import productData from '../../assets/data/product'
import { Col, Row } from 'antd';
import { Card } from 'antd';
export const Item = () => {
  return (
    <section>
      <Row>
        <Col span={4}>
          <div>
            {
              productData.map((item)=>{
                <div>
                  <div>
                    <img src={item.img}/>
                  </div>
                  <span>{item.name}</span>
                  <span>{item.price}</span>
                </div>
              })
            
            }
          </div>
        </Col>
      </Row>
    </section>
  )
}
